--
DROP TABLE IF EXISTS `item_koleksi`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `item_koleksi`  AS  select concat(year(`collections`.`CreateDate`),lpad(month(`collections`.`CreateDate`),2,0)) AS `periode`,month(`collections`.`CreateDate`) AS `bulan`,year(`collections`.`CreateDate`) AS `tahun`,count('*') AS `jumlah_eksemplar` from `collections` group by month(`collections`.`CreateDate`),year(`collections`.`CreateDate`) ;

